@FrancescoSTL @chrismore r?

I am unable to replicate the problem using a locally built and manually installed XPI but, the change I make here is the only logical thing that would make sense to me. If either the `options` argument is not passed or, it does not correctly identify a startup as a startup phase, the scenarios described will most likely occur.

Let's get this baked into a funnelcake and see if it resolves the problem.

